import React from "react";
// import { Container, Grid, Button } from "@material-ui/core";
import Wired from "../images/wired.png";
import Voiceotai from "../images/voicebotai.png";
import Siliconrepublic from "../images/siliconrepublic.png";
import Fortune from "../images/fortune_logo-1.png";
import Techcrunch from "../images/techcrunch.png";
import Edsurge from "../images/edsurge.png";
import Forbes from "../images/forbes-1.png";

function Media() {
  return (
    <div>
      <h1 style={{ textAlign: "center" }}>SoapBox in the Media</h1>
      <div
        container
        style={{ display: "flex", flexWrap: "wrap", padding: "50px 50px" }}
      >
        <img className="image-section" src={Wired} alt="Logo" />
        <img className="image-section" src={Voiceotai} alt="Logo" />
        <img className="image-section" src={Siliconrepublic} alt="Logo" />
        <img className="image-section" src={Fortune} alt="Logo" />
        <img className="image-section" src={Techcrunch} alt="Logo" />
        <img className="image-section" src={Edsurge} alt="Logo" />
        <img className="image-section" src={Forbes} alt="Logo" />
      </div>
    </div>
  );
}

export default Media;
